import React, { useEffect } from 'react'
import './header.scss'
import { NavLink } from 'react-router-dom'
import { connect } from 'react-redux'
import { initialStore } from '../../redux/reducers/basket-reducer'


const Header = props => {

    useEffect(() => {
        props.initialCount()
    }, [])

    return (
            <header className="header">
                <NavLink to="/" style={{ textDecoration: 'none', background: 'white' }}>
                    <div className="headName">
                        Book Store {console.log(props)}
                    </div>
                </NavLink>
                <NavLink to="/basket" style={{ textDecoration: 'none' }}>
                <div className="basketHeader">
                    <div> 200 $</div>
                    <div>
                        <img 
                            src="http://cdn.onlinewebfonts.com/svg/download_156067.png"
                            alt="sorry :'("  />
                    </div>
                </div>
                </NavLink>
            </header>
    )
}

function mapStateToProps(state) {
    return {
        state
    }
}
function mapDispatchToProps(dispatch) {
    return {
        initialCount: () => dispatch(initialStore())
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Header)
